import Head from '../components/head.component';
import Header from '../components/header.component';
import Footer from '../components/footer.component';
import BlockProduct from '../components/blocks.prod.component';

const Home = () => {
    return(
        <>
        <Head/>
        <main className="container-fluid">
            <Header/>
            <section className="row section-home">
                <BlockProduct crossOrigin='anonymous' section="Ofertas semanales" api='all'/>
                <BlockProduct crossOrigin='anonymous' section="Entrenamiento" api='gym'/>
                <BlockProduct crossOrigin='anonymous' section="Electrodomésticos" api='electrodomésticos'/>
            </section>
            <Footer/>
        </main>
        </>
    )
}

export default Home;
